import React from "react";

const MusicList = (props) => {

    return (
        <div className="mt-20 ml-3 flex flex-nowrap">
            <div className="h-[50px] w-[50px]">
                <img src={props.post.img} alt="Картина песни" />
            </div>
            <div className="ml-[26px] flex flex-wrap">
                <div>
                    {props.post.title}
                </div>
                <div>
                    {props.post.authorName}
                </div>
            </div>
            <div>
                {props.post.liked}
            </div>
        </div>
    )
}

export default MusicList;
